function validateForm() {
    const name = document.getElementById("name").value;
    const minHeight = parseInt(document.getElementById("min-height").value);
    const maxHeight = parseInt(document.getElementById("max-height").value);
    const minWeight = parseInt(document.getElementById("min-weight").value);
    const maxWeight = parseInt(document.getElementById("max-weight").value);
  
    if (/\d/.test(name)) {
      alert("El nombre no debe contener números.");
      return false;
    }
  
    if (maxHeight <= minHeight) {
      alert("La altura máxima debe ser mayor que la altura mínima.");
      return false;
    }
  
    if (maxWeight <= minWeight) {
      alert("El peso máximo debe ser mayor que el peso mínimo.");
      return false;
    }
  
    return true;
  }
